import React from 'react';
import {AppBar, Toolbar, Typography, Grid, Button, Dialog, DialogTitle, DialogContent, TextField, DialogActions, DialogContentText, Card, CardContent, CardActions} from '@material-ui/core';
import { makeStyles, ThemeProvider} from '@material-ui/core/styles';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';

const ProjectCard = (props) => {

    return(
        <div>
            <h1 onClick={this.props.history.push(`projects/1/`)}>Project1</h1>

            <h1 onClick={this.props.history.push(`projects/2/`)}>Project2</h1>
        </div>
    )
}

export default ProjectCard;
